import s from './Components/App/app.module.css'
import {BrowserRouter, Route} from 'react-router-dom';
import Header from "./Components/Header/Header";
import HeaderCenter from "./Components/HeaderCenter/HeaderCenter";
import PizzaContainer from "./Components/Profile/CenterHeader/Pizza/PizzaContainer";
import SneksContainer from "./Components/Profile/CenterHeader/Sneks/SneksContainer";
import DrinkContainer from "./Components/Profile/CenterHeader/Drink/DrinkContainer";
import SousContainer from "./Components/Profile/CenterHeader/Sous/SousContainer";
import CenterCenter from "./Components/Profile/CenterCenter/CenterCenter";
import CenterBottom from "./Components/CenterBottom/CenterBottom";
import FooterHeader from "./Components/FooterHeader/FooterHeader";
import FooterCenter from "./Components/FooterCenter/FooterCenter";
import FooterBottom from "./Components/FooterBottom/FooterBottom";
import Sale from "./Components/Sale/Sale";
import Profile from "./Components/Profile/Profile";


function App(props) {
    return (

        <BrowserRouter>
            <div className={s.App}>
                <Header/>
                <HeaderCenter/>
                <Route path="/sale" render={() => <Sale
                />}/>
                <Route path="/profile" render={() => <Profile
                />}/>


                <CenterBottom/>
                <FooterHeader/>
                <FooterCenter/>
                <FooterBottom/>


            </div>
        </BrowserRouter>

    );
}

export default App;
